import axios from 'axios';

const API = {
    searchGoogle: function(input) {
        return axios.get('https://www.googleapis.com/books/v1/volumes?key=AIzaSyAIY4R3KJo33zPFCjFeSoMxrFgHZBHiuw4&q=' + input);
    }
}

export default API;
